Colour pattern. Freshly collected . Body yellow, heavily invested with dark subdermal chromatophores, especially below midlateral septum (
Fig. 49
). Pale blue stripe, lying just above midlateral septum and tapering at both ends, from just behind eye at level of dorsal margin of pupil and fading out at about mid-length of caudal peduncle. A white, slightly oblique, bar about two scales wide posteriorly, thinning ventrally, broadening to about four scales wide just above midline, then narrowing to two scale widths dorsally. Large (slightly greater than eye diameter) dark red spot, much darker towards centre, covers hypural region of peduncle and proximal bases of caudal-fin rays. Blotch extends further anteriorly on lower half of body, giving anterior margin notched appearance. Iris yellow with dark mottling, with red margined blue stripe across it at level of upper pupil. Tips of jaws, upper cheek and opercle yellow, faint blue stripe below this on cheek bordered dorsally with red. Ventral margin of cheek below suffused with yellow. Scattered dark chromatophores form diffuse bar on base of pectoral fin, and tips of pelvic-fin rays tinged with mauve. Dorsal fins with dark purple basal band sprinkled with melanophores and iridocytes, followed by pupil-diameter wide yellowish stripe (broader posteriorly in both fins), distal part of fins mauve with liberal sprinkling of iridocytes. Caudal and anal fins mauve to bluish-purple, with pupil-diameter wide basal stripe of purple/red in anal fin. No underwater photographs of live specimens from Australia available. Pair of individuals with almost identical colour pattern from Biak, Indonesia shown in Pl. 4 A.

Distribution. The distribution is difficult to determine because of questions as to the potential confusion revolving around the taxonomy of this species (see Discussion). The blue striped form appears to range from the middle reaches of the Red Sea through the Maldives (but not south of this in the Indian Ocean) to the western Pacific as far east as the Marshall Islands and Samoa (
Fig. 50
).
